    }
};
export default class Onboarding extends React.Component {
    state={};
    constructor(props) {
        super();
        this.setState({modal_open: props.showModal});
    }

    render() {
        return(
            <Modal isOpen={this.props.showModal} style={customStyles}>
                Modal
